const byte* music_ptr = music1;

byte next_music_byte() {
  return *music_ptr++;
}

void play_music() {
  static byte chs = 0;
  if (music_ptr) {
    // run out duration timer yet?
    while (cur_duration == 0) {
      // fetch next byte in score
      byte note = next_music_byte();
      // is this a note?
      if ((note & 0x80) == 0) {
        int period = NOTE_TABLE[note+transpose & 63];
        // see which pulse generator is free
        if (!(chs & 1)) {
          SID_PULSE_DECAY(v1, period);
          voi1pos = 7;
          chs |= 1;
        } else if (!(chs & 2)) {
          SID_PULSE_DECAY(v2, period);
          voi2pos = 7;
          chs |= 2;
        } else if (!(chs & 4)) {
          SID_PULSE_DECAY(v3, period);
          voi3pos = 7;
          chs |= 4;
        }
      } else {
        // end of score marker
        if (note == 0xff)
          music_ptr = NULL;
        // set duration until next note
        cur_duration = note & 63;
        // reset channel used mask
        chs = 0;
      }
    }
    cur_duration--;
  }
}

void start_music(const byte* music) {
  SID_PULSE_DECAY(v1, 0);
  SID_PULSE_DECAY(v2, 0);
  SID_PULSE_DECAY(v3, 0);
  playing_track = music_index;
  music_ptr = music;
  cur_duration = 0;
}

