void update_menu(void) {
  char joy = joy_read(0);
  frames = frames + 1;
  if (JOY_UP(joy) && menu > 0 && frames >= 10) {
    --menu;
    gotoxy(0, menu+2);
    printf("*");
    gotoxy(0, menu+3);
    printf(" ");
    frames = 0;
  }
  if (JOY_DOWN(joy) && menu < 13 && frames >= 10) {
    ++menu;
    gotoxy(0, menu+2);
    printf("*");
    gotoxy(0, menu+1);
    printf(" ");
    frames = 0;
  }
  
  if(JOY_LEFT(joy) && menu == 0 && frames >= 10){
    	music_index -= 1;
    	gotoxy(9, menu+2);
    	printf("%02X", music_index);
        gotoxy(10, 23);
    	printf("%s", song_names[music_index]);
    	gotoxy(10, 24);
    	printf("%s", artist_names[music_index]);
    	frames = 0;
   }
    
  if(JOY_RIGHT(joy) && menu == 0 && frames >= 10){
    	music_index += 1; 
    	gotoxy(9, menu+2);
    	printf("%02X", music_index);
    	gotoxy(10, 23);
    	printf("%s", song_names[music_index]);
    	gotoxy(10, 24);
    	printf("%s", artist_names[music_index]);
    	frames = 0;
   }
  
  if(JOY_LEFT(joy) && menu == 1 && frames >= 10){
    	transpose -= 1;
    	gotoxy(14, menu+2);
    	printf("%02X", transpose);
    	frames = 0;
   }
    
  if(JOY_RIGHT(joy) && menu == 1 && frames >= 10){
    	transpose += 1; 
    	gotoxy(14, menu+2);
    	printf("%02X", transpose);
    	frames = 0;
   }
}

void main(void)
{
  int n;
  int x,y;
  joy_install (joy_static_stddrv);
  sid_init();
  // clear interrupts to avoid glitching
  __asm__("SEI"); 
  // set sprite bitmap data
  for (n = 0 ; n < sizeof(sprite) ; n++) {
    POKE(0x340 + n, sprite[n]);
  }
  // set background color
  VIC.bgcolor0 = 0;
  bordercolor(0);
  // set initial x/y positions
  x = 38;
  y = 232;
  // enable 1st and 2nd sprite
  VIC.spr_ena = 0xFF;
  VIC.spr_mcolor = 0x08;
  // set colors
  VIC.spr_mcolor0 = 4;
  VIC.spr_mcolor1 = 4;
  // set address of sprite data
  POKE(0x7f8, 13);
  POKE(0x7f9, 13);
  POKE(0x7fa, 13);
  // set sprite X/Y
  VIC.spr0_x = 38;
  VIC.spr1_x = 78;
  VIC.spr2_x = 118;
  VIC.spr0_y = 224;
  VIC.spr1_y = 224;
  VIC.spr2_y = 224;
  // set sprite color
  VIC.spr0_color = 10;
  VIC.spr1_color = 3;
  VIC.spr2_color = 5;
  // prepare message
  type_message();
  music_ptr = 0;
  while (1) {
    wait_vblank();
    
    if (voi1pos > 0) {
    voi1pos--;
    }
    if (voi2pos > 0) {
    voi2pos--;
    }
    if (voi3pos > 0) {
    voi3pos--;
    }
    
    VIC.spr0_y = 224 - voi1pos * 4;
    VIC.spr1_y = 224 - voi2pos * 4;
    VIC.spr2_y = 224 - voi3pos * 4;
  
     // play music
    if (playing_track != music_index) start_music(music_tables[music_index]);
    // if no music pointer and the track is a jingle, set to silence after track
    if (!music_ptr && !jingle[music_index]) {
      playing_track = 255;
    }
    play_music();
    update_menu();
  }
}

